import './App.css';
import Navbar from './components/Navbar';
import About from './pages/About';
import {BrowserRouter as Router, Route,Routes} from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path = "/about" exact element = {Navbar}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
